import { CHAR } from "axios/AxiosUtils";
import { CNPJ_ISSUER } from "common/model/Dfe";
import { CNPJ_RECIPIENT } from "common/model/Dfe";
import { CPF_ISSUER } from "common/model/Dfe";
import { DFE_VALUE } from "common/model/Dfe";
import { CPF_RECIPIENT } from "common/model/Dfe";
import { KEY } from "common/model/Dfe";
import { DHEMI } from "common/model/Dfe";
import { MDFE_DESTINATION } from "common/model/Mdfe";
import { MDFE_ORIGIN } from "common/model/Mdfe";
import { NAME } from "common/model/WarningConfig";
import { ID_CONFIG } from "common/model/WarningConfig";
import { SEVERITY } from "common/model/WarningConfig";

import { cpfFilter, cnpjFilter, dateFilter, dfeTypeFilter, priorityFilter, ufFilter } from "components/tags/filterPresets";
import { integerFilter } from "components/tags/filterPresets";
import { moneyFilter } from "components/tags/filterPresets";

export const dfeIssuanceTagFilters = {
    "Prioridade": {
      field: SEVERITY,
      ...priorityFilter
    },
    "Nº Alerta": {
      field: ID_CONFIG,
      size: 10,
      ...integerFilter
    },
    "Alerta": {
      field: NAME,
      column_type: "varying"
    },
    "Data/Hora Emissão": {
      field: DHEMI,
      ...dateFilter
    },
    "CPF Emitente": {
      field: CPF_ISSUER,
      ...cpfFilter
    },
    "CNPJ Emitente": {
      field: CNPJ_ISSUER,
      ...cnpjFilter
    },
    "CPF Destinatário": {
      field: CPF_RECIPIENT,
      ...cpfFilter
    },
    "CNPJ Destinatário": {
      field: CNPJ_RECIPIENT,
      ...cnpjFilter
    },
    "Valor do Documento": {
      field: DFE_VALUE,
      ...moneyFilter
    },
    "Tipo de DF-e": {
      field: "fiscal_notification_type",
      ...dfeTypeFilter
    },
    "Chave DF-e": {
      field: KEY,
      column_type: CHAR,
      size: 44,
      ...integerFilter
      // mask: MASK_ENUM.MONEY,
    }
  }



  export const mdfeIssuanceTagFilters = {
    "Prioridade": {
      field: SEVERITY,
      ...priorityFilter
    },
    "Nº Alerta": {
      field: ID_CONFIG,
      size: 10,
      ...integerFilter
    },
    "Alerta": {
      field: NAME,
      column_type: "varying"
    },
    "Data/Hora Emissão": {
      field: DHEMI,
      ...dateFilter
    },
    "UF Origem": {
      field: MDFE_ORIGIN,
      ...ufFilter
    },
    "UF Destino": {
      field: MDFE_DESTINATION,
      ...ufFilter
    },
    "CPF Emitente": {
      field: CPF_ISSUER,
      ...cpfFilter
    },
    "CNPJ Emitente ": {
      field: CNPJ_ISSUER,
      ...cnpjFilter
    },
    "Valor do Documento": {
      field: DFE_VALUE,
      ...moneyFilter
    },
    "Tipo de DF-e": {
      field: "fiscal_notification_type",
      ...dfeTypeFilter
    },
    "Chave DF-e": {
      field: KEY,
      column_type: CHAR,
      size: 44,
      ...integerFilter
      // mask: MASK_ENUM.MONEY,
    }
  }
